const imgLevel = ({ level, attempts, image }) => {
  return (
    <div>
      <h2>Level {level}</h2>
      <p>Attempts: {attempts}</p>
      <img src={image} alt={`Level ${level}`} />
    </div>
  );
};

export default imgLevel;
